import React from 'react';
import './ProductTopSection.css'; // Import CSS file for styling

const ProductTopSection = () => {
  return (
    <div className="text-container">
    <div className="text-wrapper">
      <h1 className="heading-large">Simple, transparent pricing that scales with you</h1>
      <p className="paragraph-small">With font size 24</p>
    </div>
  </div>
  );
}

export default ProductTopSection;
